import React, { useEffect, useState, useCallback } from 'react';
import { useNavigate } from 'react-router-dom';
import jwtDecode from 'jwt-decode';
import API from '../api';
import SalesTrendChart from '../components/SalesTrendChart';
import TopCustomersBarChart from '../components/TopCustomersBarChart';

export default function DashboardPage() {
  const [tenantInfo, setTenantInfo] = useState(null);
  const [overview, setOverview] = useState(null);
  const [eventSummary, setEventSummary] = useState(null);
  const [topCustomers, setTopCustomers] = useState([]);
  const [orders, setOrders] = useState([]);
  const [customerHistory, setCustomerHistory] = useState([]);
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(true);
  const [ingesting, setIngesting] = useState(false);
  const [startDate, setStartDate] = useState('');
  const [endDate, setEndDate] = useState('');
  const [salesTrend, setSalesTrend] = useState([]);
  const [topCustomersChartData, setTopCustomersChartData] = useState([]);
  const navigate = useNavigate();

  const handleLogout = useCallback(() => {
    localStorage.removeItem('token');
    navigate('/login');
  }, [navigate]);

  const fetchData = useCallback(async () => {
    try {
      setLoading(true);
      const [
        tenantInfoRes, overviewRes, eventSummaryRes, topCustomersRes,
        ordersRes, customerHistoryRes, salesTrendRes, topCustomersChartRes
      ] = await Promise.all([
        API.get('/dashboard/tenant-info'),
        API.get('/dashboard/overview'),
        API.get('/dashboard/events-summary'),
        API.get('/dashboard/top-customers'),
        API.get('/dashboard/orders'),
        API.get('/dashboard/customer-products'),
        API.get('/dashboard/sales-trend'),
        API.get('/dashboard/top-customers-chart')
      ]);

      setTenantInfo(tenantInfoRes.data);
      setOverview(overviewRes.data);
      setEventSummary(eventSummaryRes.data);
      setTopCustomers(topCustomersRes.data.top);
      setOrders(ordersRes.data.orders);
      setCustomerHistory(customerHistoryRes.data);
      setSalesTrend(salesTrendRes.data);
      setTopCustomersChartData(topCustomersChartRes.data);
      setError('');
    } catch (err) {
      setError('Failed to fetch dashboard data.');
      if (err.response?.status === 401) handleLogout();
    } finally {
      setLoading(false);
    }
  }, [handleLogout]);

  useEffect(() => { fetchData(); }, [fetchData]);

  const handleIngestData = async () => {
    try {
      setIngesting(true);
      setError('');
      const token = localStorage.getItem('token');
      const { tenantId } = jwtDecode(token);

      await API.post(`/ingest/tenant/${tenantId}/products`, [
        { "id": 101, "title": "Classic T-Shirt", "price": "25.00" },
        { "id": 102, "title": "Denim Jeans", "price": "75.00" },
        { "id": 103, "title": "Leather Belt", "price": "35.00" },
        { "id": 104, "title": "Sunglasses", "price": "55.00" },
        { "id": 105, "title": "Cozy Hoodie", "price": "60.00" },
        { "id": 106, "title": "Knit Beanie", "price": "20.00" },
      ]);

      await API.post(`/ingest/tenant/${tenantId}/customers`, [
        { "id": 201, "first_name": "Priya", "last_name": "Sharma", "email": "priya.s@example.com" },
        { "id": 202, "first_name": "Rohan", "last_name": "Kumar", "email": "rohan.k@example.com" },
        { "id": 203, "first_name": "Anjali", "last_name": "Gupta", "email": "anjali.g@example.com" },
        { "id": 204, "first_name": "Vikram", "last_name": "Singh", "email": "vikram.s@example.com" },
        { "id": 205, "first_name": "Sneha", "last_name": "Patel", "email": "sneha.p@example.com" },
        { "id": 206, "first_name": "Amit", "last_name": "Verma", "email": "amit.v@example.com" },
        { "id": 207, "first_name": "Deepika", "last_name": "Reddy", "email": "deepika.r@example.com" },
        { "id": 208, "first_name": "Sanjay", "last_name": "Joshi", "email": "sanjay.j@example.com" },
        { "id": 209, "first_name": "Neha", "last_name": "Mehta", "email": "neha.m@example.com" },
        { "id": 210, "first_name": "Rajesh", "last_name": "Nair", "email": "rajesh.n@example.com" },
      ]);

      await API.post(`/ingest/tenant/${tenantId}/orders`, [
        /* your sample orders array as before */
      ]);

      await API.post(`/ingest/tenant/${tenantId}/events`, [
        /* your sample events array as before */
      ]);

      await fetchData();
    } catch (err) {
      setError('Failed to ingest data. Please check the server logs.');
    } finally {
      setIngesting(false);
    }
  };

  const handleFilterOrders = async () => {
    try {
      setError('');
      const params = new URLSearchParams();
      if (startDate) params.append('from', startDate);
      if (endDate) params.append('to', endDate);

      const res = await API.get(`/dashboard/orders?${params.toString()}`);
      setOrders(res.data.orders);
    } catch (err) {
      setError('Failed to filter orders.');
    }
  };

  const averageOrderValue = (overview && overview.totalOrders > 0)
    ? (overview.revenue / overview.totalOrders)
    : 0;

  if (loading) return <h2>Loading dashboard...</h2>;

  return (
    <div style={{ padding: '20px' }}>
      <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginBottom: '20px' }}>
        <div style={{ display: 'flex', alignItems: 'center', gap: '15px' }}>
          {tenantInfo && tenantInfo.logoUrl && (
            <img src={tenantInfo.logoUrl} alt={`${tenantInfo.name} Logo`} style={{ height: '50px', width: '50px', objectFit: 'contain' }} />
          )}
          <div>
            <h2 style={{ margin: 0 }}>{tenantInfo ? tenantInfo.name : 'Dashboard'}</h2>
            <p style={{ margin: '5px 0', color: '#555' }}>Owner: {tenantInfo ? tenantInfo.adminEmail : '...'}</p>
          </div>
        </div>
        <button onClick={handleLogout} style={{ padding: '8px 12px', width: 'auto' }}>Logout</button>
      </div>

      {/* Load Sample Data Section */}
      {overview && overview.totalCustomers === 0 && (
        <div style={{ padding: '20px', margin: '20px 0', backgroundColor: '#eef', border: '1px solid #ccf' }}>
          <h4>Your dashboard is empty!</h4>
          <p>Click the button below to load some sample customer and order data.</p>
          <button onClick={handleIngestData} disabled={ingesting} style={{ width: 'auto' }}>
            {ingesting ? 'Ingesting...' : 'Load Sample Data'}
          </button>
        </div>
      )}

      {error && <div style={{ color: 'red', margin: '10px 0' }}>{error}</div>}

      {/* Rest of your dashboard widgets (overview, charts, orders, customer history) */}
      {/* ... keep everything as in your original DashboardPage ... */}
    </div>
  );
}
